suite('Profile', function () {
  this.timeout(15000);

  suiteSetup(loadUsers);
  suite('Profile test', function () {

    test('signIn hommer', function (done) {
      this.timeout(10000);
      hoodie.account.signIn('Hommer', '123')
        .fail(function (err) {
          assert.ok(false, err.message);
          done();
        })
        .done(function () {
          assert.equal(
            hoodie.account.username,
            'hommer',
            'should be logged in after signup'
          );
          done();
        });
    });

    var image = "data:image/jpeg;base64,"
    test('hommer should upload own image', function (done) {
      this.timeout(10000);
      hoodie.image.upload(image)
        .fail(function (err) {
          assert.ok(false, err);
          done();
        })
        .then(function (task) {
          assert.ok(true, 'getProfile');
          done();
        })
    });

    test('hommer should upload own image with userData', function (done) {
      this.timeout(10000);
      hoodie.image.upload(image, null, {type: 'post'})
        .fail(function (err) {
          assert.ok(false, err);
          done();
        })
        .then(function (task) {
          assert.ok(true, 'getProfile');
          done();
        })
    });

    test('hommer should upload own image with name', function (done) {
      this.timeout(10000);
      hoodie.image.upload(image, 'profile')
        .fail(function (err) {
          assert.ok(false, err);
          done();
        })
        .then(function (task) {
          assert.ok(true, 'getProfile');
          done();
        })
    });

    test('hommer should upload own image with name and userData', function (done) {
      this.timeout(10000);
      hoodie.image.upload(image, 'post', { post: 'coolest'})
        .fail(function (err) {
          assert.ok(false, err);
          done();
        })
        .then(function (task) {
          assert.ok(true, 'getProfile');
          done();
        })
    });


  });

});
